import React from "react";
import { Text, StyleSheet, View, Button, TouchableOpacity, ShadowPropTypesIOS } from "react-native";

const HomeScreen = (props) => {
  return (
    <View>
      <Text style={styles.text}>HomeScreen</Text>
      <TouchableOpacity onPress={ ()=> props.navigation.navigate('Components')}>
        <Text>GoTo components Demo</Text>
      </TouchableOpacity>
      <TouchableOpacity onPress={ ()=> props.navigation.navigate('List')}>
        <Text>GoTo List Demo</Text>
      </TouchableOpacity>
    </View>
  );
};

const styles = StyleSheet.create({
  text: {
    fontSize: 30,
  }
});

export default HomeScreen;
